// api
import { instanceAxios } from '../../utils/api';

export const authMeAPI = {
    async getAuthMe() {
            const response = await instanceAxios.get('/auth/me');
            return response.data;
    },

    async login(email, password, rememberMe, captcha ) {
        const response = await instanceAxios.post('/auth/login', {
            email: email,
            password: password,
            rememberMe: rememberMe,
            captcha: captcha })
        return response.data
    },

    loginOut() {
        return instanceAxios.delete('/auth/login')
        .then(response => {
            return response.data
        })
    }
}

export const securityAPI = {
    getCaptcha() {
        return instanceAxios.get('/security/get-captcha-url')
            .then(response => {
                return response.data
            })
    },
}
